package swa.job.common.entity;import java.io.Serializable;import java.util.Date;/** * Application:应用表 * Created by jinyan.cao on 2017-10-23 18:43:08 */public class Application implements Serializable {	private static final long serialVersionUID = 1L;		/**	 *自增主键	 */	private Long id;	/**	 *应用名	 */	private String appName;	/**	 *服务器地址	 */	private String address;	/**	 *创建时间	 */	private Date createTime;	/**	 *更新时间	 */	private Date updateTime;	public Long getId() {	    return this.id;	}	public void setId(Long id) {	    this.id=id;	}	public String getAppName() {	    return this.appName;	}	public void setAppName(String appName) {	    this.appName=appName;	}	public String getAddress() {	    return this.address;	}	public void setAddress(String address) {	    this.address=address;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}	public Date getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(Date updateTime) {	    this.updateTime=updateTime;	}}